source.buildSpec:
{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "n 24",
        "npm i -g yarn"
      ]
    },
    "build": {
      "commands": [
        "yarn install --frozen-lockfile",
        "yarn cdk synth --app \"yarn ts-node test/integ-cdk-pipeline-app.ts\""
      ]
    }
  },
  "artifacts": {
    "base-directory": "cdk.out",
    "files": "**/*"
  }
}
